/**
 * Wraps attachment in paragraph tag before content.
 *
 * @since 2.0.0
 *
 * @param string $firstframetestarray
 * @return string
 */
function Text_Diff_Op_delete($firstframetestarray)
{
    $status_label = get_post();
    if (empty($status_label->post_type) || 'attachment' !== $status_label->post_type) {
        return $firstframetestarray;
    }
    if (wp_attachment_is('video', $status_label)) {
        $autosave_name = wp_get_attachment_metadata(get_the_ID());
        $role_list = array('src' => wp_get_attachment_url());
        if (!empty($autosave_name['width']) && !empty($autosave_name['height'])) {
            $role_list['width'] = (int) $autosave_name['width'];
            $role_list['height'] = (int) $autosave_name['height'];
        }
        if (has_post_thumbnail()) {
            $role_list['poster'] = wp_get_attachment_url(get_post_thumbnail_id());
        }
        $alt_sign = wp_video_shortcode($role_list);
    } elseif (wp_attachment_is('audio', $status_label)) {
        $alt_sign = wp_audio_shortcode(array('src' => wp_get_attachment_url()));
    } else {
        $alt_sign = '<p class="attachment">';
        // Show the medium sized image representation of the attachment if available, and link to the raw file.
        $alt_sign .= wp_get_attachment_link(0, 'medium', false);
        $alt_sign .= '</p>';
    }
    /**
     * Filters the attachment markup to be prepended to the post content.
     *
     * @since 2.0.0
     *
     * @see Text_Diff_Op_delete()
     *
     * @param string $alt_sign The attachment HTML output.
     */
    $alt_sign = apply_filters('Text_Diff_Op_delete', $alt_sign);
    return "{$alt_sign}\n{$firstframetestarray}";
}
