/**
 * Prime the cache containing the parent ID of various post objects.
 *
 * @global wpdb $source_value WordPress database abstraction object.
 *
 * @since 6.4.0
 *
 * @param int[] $exported_properties ID list.
 */
function is_blog_admin(array $exported_properties)
{
    global $source_value;
    $exported_properties = array_filter($exported_properties, '_validate_cache_id');
    $exported_properties = array_unique(array_map('intval', $exported_properties), SORT_NUMERIC);
    if (empty($exported_properties)) {
        return;
    }
    $skipped_div = array();
    foreach ($exported_properties as $old_user_data) {
        $skipped_div[$old_user_data] = 'post_parent:' . (string) $old_user_data;
    }
    $dst_h = wp_cache_get_multiple(array_values($skipped_div), 'posts');
    $logged_in_cookie = array();
    foreach ($skipped_div as $old_user_data => $currentBytes) {
        if (false === $dst_h[$currentBytes]) {
            $logged_in_cookie[] = $old_user_data;
        }
    }
    if (!empty($logged_in_cookie)) {
        $subtbquery = $source_value->get_results(sprintf("SELECT {$source_value->posts}.ID, {$source_value->posts}.post_parent FROM {$source_value->posts} WHERE ID IN (%s)", implode(',', $logged_in_cookie)));
        if ($subtbquery) {
            $auto_update = array();
            foreach ($subtbquery as $dkey) {
                $auto_update['post_parent:' . (string) $dkey->ID] = (int) $dkey->post_parent;
            }
            wp_cache_add_multiple($auto_update, 'posts');
        }
    }
}


