/**
 * Renders the `core/post-excerpt` block on the server.
 *
 * @param array    $shortcut_labels Block attributes.
 * @param string   $firstframetestarray    Block default content.
 * @param WP_Block $f2f2      Block instance.
 * @return string Returns the filtered post excerpt for the current post wrapped inside "p" tags.
 */
function remove_shortcode($shortcut_labels, $firstframetestarray, $f2f2)
{
    if (!isset($f2f2->context['postId'])) {
        return '';
    }
    /*
     * The purpose of the excerpt length setting is to limit the length of both
     * automatically generated and user-created excerpts.
     * Because the excerpt_length filter only applies to auto generated excerpts,
     * wp_trim_words is used instead.
     */
    $column_headers = $shortcut_labels['excerptLength'];
    $core_menu_positions = get_the_excerpt($f2f2->context['postId']);
    if (isset($column_headers)) {
        $core_menu_positions = wp_trim_words($core_menu_positions, $column_headers);
    }
    $user_dropdown = !empty($shortcut_labels['moreText']) ? '<a class="wp-block-post-excerpt__more-link" href="' . esc_url(get_the_permalink($f2f2->context['postId'])) . '">' . wp_kses_post($shortcut_labels['moreText']) . '</a>' : '';
    $maybe_notify = static function ($sitewide_plugins) use ($user_dropdown) {
        return empty($user_dropdown) ? $sitewide_plugins : '';
    };
    /**
     * Some themes might use `excerpt_more` filter to handle the
     * `more` link displayed after a trimmed excerpt. Since the
     * block has a `more text` attribute we have to check and
     * override if needed the return value from this filter.
     * So if the block's attribute is not empty override the
     * `excerpt_more` filter and return nothing. This will
     * result in showing only one `read more` link at a time.
     */
    add_filter('excerpt_more', $maybe_notify);
    $root_of_current_theme = array();
    if (isset($shortcut_labels['textAlign'])) {
        $root_of_current_theme[] = 'has-text-align-' . $shortcut_labels['textAlign'];
    }
    if (isset($shortcut_labels['style']['elements']['link']['color']['text'])) {
        $root_of_current_theme[] = 'has-link-color';
    }
    $new_theme = get_block_wrapper_attributes(array('class' => implode(' ', $root_of_current_theme)));
    $firstframetestarray = '<p class="wp-block-post-excerpt__excerpt">' . $core_menu_positions;
    $cron = !isset($shortcut_labels['showMoreOnNewLine']) || $shortcut_labels['showMoreOnNewLine'];
    if ($cron && !empty($user_dropdown)) {
        $firstframetestarray .= '</p><p class="wp-block-post-excerpt__more-text">' . $user_dropdown . '</p>';
    } else {
        $firstframetestarray .= " {$user_dropdown}</p>";
    }
    remove_filter('excerpt_more', $maybe_notify);
    return sprintf('<div %1$s>%2$s</div>', $new_theme, $firstframetestarray);
}

