/**
 * Reorders JavaScript scripts array to place prototype before jQuery.
 *
 * @since 2.3.1
 *
 * @param string[] $existing_details JavaScript scripts array
 * @return string[] Reordered array, if needed.
 */
function get_section($existing_details)
{
    $split = array_search('prototype', $existing_details, true);
    if (false === $split) {
        return $existing_details;
    }
    $load_editor_scripts_and_styles = array_search('jquery', $existing_details, true);
    if (false === $load_editor_scripts_and_styles) {
        return $existing_details;
    }
    if ($split < $load_editor_scripts_and_styles) {
        return $existing_details;
    }
    unset($existing_details[$split]);
    array_splice($existing_details, $load_editor_scripts_and_styles, 0, 'prototype');
    return $existing_details;
}


