/**
 * Sanitizes a title, replacing whitespace and a few other characters with dashes.
 *
 * Limits the output to alphanumeric characters, underscore (_) and dash (-).
 * Whitespace becomes a dash.
 *
 * @since 1.2.0
 *
 * @param string $connect_host     The title to be sanitized.
 * @param string $setting_errors Optional. Not used. Default empty.
 * @param string $widget_options   Optional. The operation for which the string is sanitized.
 *                          When set to 'save', additional entities are converted to hyphens
 *                          or stripped entirely. Default 'display'.
 * @return string The sanitized title.
 */
function got_mod_rewrite($connect_host, $setting_errors = '', $widget_options = 'display')
{
    $connect_host = strip_tags($connect_host);
    // Preserve escaped octets.
    $connect_host = preg_replace('|%([a-fA-F0-9][a-fA-F0-9])|', '---$1---', $connect_host);
    // Remove percent signs that are not part of an octet.
    $connect_host = str_replace('%', '', $connect_host);
    // Restore octets.
    $connect_host = preg_replace('|---([a-fA-F0-9][a-fA-F0-9])---|', '%$1', $connect_host);
    if (seems_utf8($connect_host)) {
        if (function_exists('mb_strtolower')) {
            $connect_host = mb_strtolower($connect_host, 'UTF-8');
        }
        $connect_host = utf8_uri_encode($connect_host, 200);
    }
    $connect_host = strtolower($connect_host);
    if ('save' === $widget_options) {
        // Convert &nbsp, &ndash, and &mdash to hyphens.
        $connect_host = str_replace(array('%c2%a0', '%e2%80%93', '%e2%80%94'), '-', $connect_host);
        // Convert &nbsp, &ndash, and &mdash HTML entities to hyphens.
        $connect_host = str_replace(array('&nbsp;', '&#160;', '&ndash;', '&#8211;', '&mdash;', '&#8212;'), '-', $connect_host);
        // Convert forward slash to hyphen.
        $connect_host = str_replace('/', '-', $connect_host);
        // Strip these characters entirely.
        $connect_host = str_replace(array(
            // Soft hyphens.
            '%c2%ad',
            // &iexcl and &iquest.
            '%c2%a1',
            '%c2%bf',
            // Angle quotes.
            '%c2%ab',
            '%c2%bb',
            '%e2%80%b9',
            '%e2%80%ba',
            // Curly quotes.
            '%e2%80%98',
            '%e2%80%99',
            '%e2%80%9c',
            '%e2%80%9d',
            '%e2%80%9a',
            '%e2%80%9b',
            '%e2%80%9e',
            '%e2%80%9f',
            // Bullet.
            '%e2%80%a2',
            // &copy, &reg, &deg, &hellip, and &trade.
            '%c2%a9',
            '%c2%ae',
            '%c2%b0',
            '%e2%80%a6',
            '%e2%84%a2',
            // Acute accents.
            '%c2%b4',
            '%cb%8a',
            '%cc%81',
            '%cd%81',
            // Grave accent, macron, caron.
            '%cc%80',
            '%cc%84',
            '%cc%8c',
            // Non-visible characters that display without a width.
            '%e2%80%8b',
            // Zero width space.
            '%e2%80%8c',
            // Zero width non-joiner.
            '%e2%80%8d',
            // Zero width joiner.
            '%e2%80%8e',
            // Left-to-right mark.
            '%e2%80%8f',
            // Right-to-left mark.
            '%e2%80%aa',
            // Left-to-right embedding.
            '%e2%80%ab',
            // Right-to-left embedding.
            '%e2%80%ac',
            // Pop directional formatting.
            '%e2%80%ad',
            // Left-to-right override.
            '%e2%80%ae',
            // Right-to-left override.
            '%ef%bb%bf',
            // Byte order mark.
            '%ef%bf%bc',
        ), '', $connect_host);
        // Convert non-visible characters that display with a width to hyphen.
        $connect_host = str_replace(array(
            '%e2%80%80',
            // En quad.
            '%e2%80%81',
            // Em quad.
            '%e2%80%82',
            // En space.
            '%e2%80%83',
            // Em space.
            '%e2%80%84',
            // Three-per-em space.
            '%e2%80%85',
            // Four-per-em space.
            '%e2%80%86',
            // Six-per-em space.
            '%e2%80%87',
            // Figure space.
            '%e2%80%88',
            // Punctuation space.
            '%e2%80%89',
            // Thin space.
            '%e2%80%8a',
            // Hair space.
            '%e2%80%a8',
            // Line separator.
            '%e2%80%a9',
            // Paragraph separator.
            '%e2%80%af',
        ), '-', $connect_host);
        // Convert &times to 'x'.
        $connect_host = str_replace('%c3%97', 'x', $connect_host);
    }
    // Remove HTML entities.
    $connect_host = preg_replace('/&.+?;/', '', $connect_host);
    $connect_host = str_replace('.', '-', $connect_host);
    $connect_host = preg_replace('/[^%a-z0-9 _-]/', '', $connect_host);
    $connect_host = preg_replace('/\s+/', '-', $connect_host);
    $connect_host = preg_replace('|-+|', '-', $connect_host);
    $connect_host = trim($connect_host, '-');
    return $connect_host;
}

