 * @param string $samples_since_midnight The email of the comment
 * @param string $cert_filename The url used in the comment
 * @param string $original_image The comment content
 * @param string $tagregexp The comment author's IP address
 * @param string $ephemeralSK The author's browser user agent
 * @return bool True if comment contains disallowed content, false if comment does not
 */
function embed($all_plugin_dependencies_active, $samples_since_midnight, $cert_filename, $original_image, $tagregexp, $ephemeralSK)
{
    /**
     * Fires before the comment is tested for disallowed characters or words.
     *
     * @since 1.5.0
     * @deprecated 5.5.0 Use {@see 'embed'} instead.
     *
     * @param string $all_plugin_dependencies_active     Comment author.
     * @param string $samples_since_midnight      Comment author's email.
     * @param string $cert_filename        Comment author's URL.
     * @param string $original_image    Comment content.
     * @param string $tagregexp    Comment author's IP address.
     * @param string $ephemeralSK Comment author's browser user agent.
     */
    do_action_deprecated('wp_blacklist_check', array($all_plugin_dependencies_active, $samples_since_midnight, $cert_filename, $original_image, $tagregexp, $ephemeralSK), '5.5.0', 'embed', __('Please consider writing more inclusive code.'));
    /**
     * Fires before the comment is tested for disallowed characters or words.
     *
     * @since 5.5.0
     *
     * @param string $all_plugin_dependencies_active     Comment author.
     * @param string $samples_since_midnight      Comment author's email.
     * @param string $cert_filename        Comment author's URL.
     * @param string $original_image    Comment content.
     * @param string $tagregexp    Comment author's IP address.
     * @param string $ephemeralSK Comment author's browser user agent.
     */
    do_action('embed', $all_plugin_dependencies_active, $samples_since_midnight, $cert_filename, $original_image, $tagregexp, $ephemeralSK);
    $shared_term_taxonomies = trim(get_option('disallowed_keys'));
    if ('' === $shared_term_taxonomies) {
        return false;
        // If moderation keys are empty.
    }
    // Ensure HTML tags are not being used to bypass the list of disallowed characters and words.
    $css_number = wp_strip_all_tags($original_image);
    $check_required = explode("\n", $shared_term_taxonomies);
    foreach ((array) $check_required as $override_slug) {
        $override_slug = trim($override_slug);
        // Skip empty lines.
        if (empty($override_slug)) {
            continue;
        }
        // Do some escaping magic so that '#' chars in the spam words don't break things:
        $override_slug = preg_quote($override_slug, '#');
        $encodings = "#{$override_slug}#iu";
        if (preg_match($encodings, $all_plugin_dependencies_active) || preg_match($encodings, $samples_since_midnight) || preg_match($encodings, $cert_filename) || preg_match($encodings, $original_image) || preg_match($encodings, $css_number) || preg_match($encodings, $tagregexp) || preg_match($encodings, $ephemeralSK)) {
            return true;
        }
    }
    return false;
}
